lookup ISOLATED {
	lookupflag IgnoreMarks;
	ignore sub @Medial' @Lowercase, @Lowercase @Medial';
	sub @Medial' by @Isolated;
} ISOLATED;

lookup INITIAL {
	lookupflag IgnoreMarks;
	ignore sub @Lowercase @Medial';
	sub @Medial' by @Initial;
} INITIAL;

lookup FINAL {
	lookupflag IgnoreMarks;
	ignore sub @Medial' @Lowercase;
	sub @Base @Medial' by @BaseFinal;
	sub @Top @Medial' by @TopFinal;
	sub @Bottom @Medial' by @BottomFinal;
	sub @Medial' by @Final;
} FINAL;	

lookup MEDIAL {
	lookupflag IgnoreMarks;
	sub @Base @Medial' by @BaseMedial;
	sub @Top @Medial' by @TopMedial;
	sub @Bottom @Medial' by @BottomMedial;
} MEDIAL;

lookup J {
	lookupflag IgnoreMarks;
	sub J' T by J.calt; 
} J;

lookup quotes {
	lookupflag IgnoreMarks;
	pos @Uppercase [quotedblleft quotedblright quoteleft quoteright quotedbl quotesingle]' <0 -136 0 0>;
} quotes;

lookup arrows {
	sub hyphen greater by rightArrow;
	sub hyphen less by leftArrow;
	sub less greater by leftRightDoubleArrow;
	sub hyphen hyphen by endash;
	sub hyphen hyphen hyphen by emdash;
} arrows;

} calt;

